import React from "react";
import '../Css/Navbar.css';

function Navbar () {
  return (
    <nav className="navbar">
      <span> Posts </span>
      <span> Comments </span>
      <span> Albums </span>
      <span> Photos </span>
      <span> Todos </span>
      <span> Users </span>
    </nav>
  );
}

export default Navbar;
